import React from "react";
import { MDBBtn, MDBIcon } from "mdbreact";
import "./Contacts.css";

export const Contact = () => (
  <div class="contact_page">
    <div className="papa_contact text-center">
      <div className="texto_contact">
        <MDBBtn social="so" size="lg">
          <MDBIcon fab icon="stack-overflow" className="pr-1" /> Stack Overflow
        </MDBBtn>
        <span>9(999)-999-99-99</span>
        <div className="contact-item">
          <button type="button" class="btn btn-gplus">
            <i class="fab fa-google-plus-g pr-1"></i> Google +
          </button>
        </div>
      </div>
    </div>
  </div>
);
